import React from 'react';

import {
    Card,
    Form,
    Input,
    Button,
    Table,
    message,
    Popconfirm,
    Space,
} from "antd";
import {
    EditOutlined,
    DeleteOutlined,
    SearchOutlined,
} from "@ant-design/icons";

const NewTemplate = (props) => {
    let formFields = {}
   
    const layout = {
        labelCol: {
            span: 8,
        },
        wrapperCol: {
            span: 16,
        },
        textalign: "center",
    };

    const cardLayout = {
        width: 1070,
        marginLeft: 25, 
        marginRight: 25, 
        marginTop: 25, 
        paddingBottom: 20,
        paddingLeft: 50
    }

    return(
        <Card  {...cardLayout}>
            <div></div>
        <Form onSubmit={ (e) => { 
            e.preventDefault();
            props.handleFormSubmit(
                formFields.name.value,
                formFields.description.value
            ); 
            e.target.reset();}
            } {...layout}  >
        <Form.Item
            name=""
            label="テンプレート種類"
            rules={[
                {
                    required: true,
                },
            ]}
        >
            <Input style={{width: 300}} />
        </Form.Item>
        <Form.Item
        name={['user', 'email']}
        label="表示順"
        rules={[
          {
            required: true,
          },
        ]}
        >
            <Input style={{width: 300}} />
        </Form.Item>

        <Form.Item
        name={['user', 'email']}
        label="テンプレート名称"
        rules={[
          {
            required: true,
          },
        ]}
        >
            <Input style={{width: 300}} />
        </Form.Item>
      
        <Form.Item name={['user', 'introduction']} label="テンプレート内容">
            <Input.TextArea style={{width: 300}} />
        </Form.Item>
        <Form.Item wrapperCol={{ ...layout.wrapperCol, offset: 8 }}>
            <Button type="primary" htmlType="submit">
                Submit
            </Button>
        </Form.Item>
    </Form>
    </Card>
    )
  }
export default NewTemplate;
